		this.stop();
		
		createjs.Touch.enable(stage);
		stage.mouseMoveOutside = true;
		
		var root = this;
		var midpoint = this.stage.canvas.width / 2;
		var panRestX = this.hanging_pots.x;
		
		var ratRestX = this.rathead.x;
		var ratRestY = this.rathead.y;
		
